purpose1:{menu:"Almacenamiento y acceso a la informaci\u00f3n",title:"Almacenamiento y acceso a la informaci\u00f3n",description:"El almacenamiento de informaci\u00f3n, o el acceso a la informaci\u00f3n que ya est\u00e1 almacenada, en su dispositivo como identificadores de publicidad, identificadores de dispositivos, cookies y tecnolog\u00edas similares."},purpose2:{menu:"Personalizaci\u00f3n",title:"Personalizaci\u00f3n",description:"La recopilaci\u00f3n y el procesamiento de informaci\u00f3n sobre el uso de este servicio para personalizar posteriormente la publicidad y/o el contenido para usted en otros contextos, como en otros sitios web o aplicaciones, a lo largo del tiempo. Normalmente, el contenido del sitio o aplicaci\u00f3n se utiliza para hacer inferencias acerca de sus intereses, lo cual informa la futura selecci\u00f3n de publicidad y/o contenido."},
purpose3:{menu:"Selecci\u00f3n, entrega y reporte de anuncios",title:"Selecci\u00f3n, entrega y reporte de anuncios",description:"La recopilaci\u00f3n de informaci\u00f3n, y la combinaci\u00f3n con la informaci\u00f3n recopilada previamente, para seleccionar y entregar anuncios para usted, y para medir la entrega y la eficacia de dichos anuncios. Esto incluye el uso de informaci\u00f3n recopilada previamente sobre sus intereses para seleccionar anuncios, el procesamiento de datos sobre qu\u00e9 anuncios se mostraron, con qu\u00e9 frecuencia se mostraron, cu\u00e1ndo y d\u00f3nde se mostraron, y si usted realiz\u00f3 alguna acci\u00f3n relacionada con el anuncio, incluyendo, por ejemplo, hacer clic en un anuncio o realizar una compra. Esto no incluye la personalizaci\u00f3n, que es la recopilaci\u00f3n y el procesamiento de informaci\u00f3n sobre el uso de este servicio para personalizar posteriormente la publicidad y/o el contenido para usted en otros contextos, como sitios web o aplicaciones, a lo largo del tiempo."},
