description:"Nedan f\u00f6ljer en komplett lista med personlig identifierbar information som kan samlas in.",optoutdDescription:"Beroende p\u00e5 vilken typ av information de samlar in, anv\u00e4nder och bearbetar, samt andra faktorer inklusive integritet genom design,\n      f\u00f6rlitar vissa partners sig p\u00e5 ditt samtycke medan andra kr\u00e4ver att du hoppar av p\u00e5 grund av deras legitima intressen. F\u00f6r information om varje leverant\u00f6r och f\u00f6r att ut\u00f6va dina val, se nedan. F\u00f6r att hoppa av, bes\u00f6k\n      \x3ca href\x3d'http://optout.networkadvertising.org/?c\x3d1#!/' target\x3d'_blank' \x3eNAI\x3c/a\x3e\n        , \x3ca href\x3d'http://optout.aboutads.info/?c\x3d2#!/' target\x3d'_blank' \x3eDAA\x3c/a\x3e\n        , eller\n      \x3ca href\x3d'http://youronlinechoices.eu/' target\x3d'_blank' \x3eEDAA\x3c/a\x3e sidor.",
